  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0116979 includes Surface
  underway, chemical, meteorological and physical data collected from NOAA Ship RONALD
  H. BROWN in the South Atlantic Ocean from 2013-12-23 to 2014-02-04 and retrieved
  during cruise 33RO20131223. These data include AIR-SEA DIFFERENCE - PARTIAL PRESSURE
  (OR FUGACITY) OF CARBON DIOXIDE, BAROMETRIC PRESSURE, Partial pressure (or fugacity)
  of carbon dioxide - atmosphere, Partial pressure (or fugacity) of carbon dioxide
  - water, SALINITY and SEA SURFACE TEMPERATURE. The instruments used to collect these
  data include Carbon dioxide (CO2) gas analyzer, Shower head chamber equilibrator
  for autonomous carbon dioxide (CO2) measurement, not applicable and thermosalinographs.
  These data were collected by Rik Wanninkhof of US DOC; NOAA; OAR; Atlantic Oceanographic
  and Meteorological Laboratory as part of the VOS_A16S_2013 data set.nnThe Global
  Volunteer Observing Ship (VOS) Program is coordinated by the UNESCO International
  Ocean Carbon Coordination Project (IOCCP). International groups from 14 countries
  have been outfitting research ships and commercial vessels with automated CO2 sampling
  equipment to analyze the carbon exchange between the ocean and atmosphere.\",\n\t\"owner_org\":
